import React from "react";
function Header() {
    return (
        <header className="py-4">
            <div className="container text-center">
                <img
                    alt=""
                    src="/images/airportlogo.png"
                    width="1100"
                    height="100"
                />
            </div>
        </header>
    );
}

export default Header;
